from django.shortcuts import render
from django.http import HttpRequest,HttpResponse
from datetime import datetime
from django.utils.crypto import get_random_string

# Create your views here.
def home_page(request:HttpRequest):

    return render(request ,'main/home.html')
def date_today_view(request:HttpRequest):
    
    date_opj = datetime.now()
    format_date = date_opj.strftime("%d %B %Y - %H:%M %p")
    
    context={
        "date": format_date
    }
    return render(request,"main/date.html",context)

def password_view(request:HttpRequest):
    password = get_random_string(length=8)
    context={
        "password":password
    }
    return render(request , "main/password.html",context )
def list_games_view(request:HttpRequest):
    favorite_games = [
        {'title': 'PUBG MOBILE', 'image_url': 'data:image/jpeg;base64,'},
        {'title': 'RED DEAD', 'image_url': 'data:image/jpeg;base64,'},
    ]
    return render(request , "main/games.html",{'favorite_games': favorite_games})